import React, { useState } from "react";
import Header from "../components/Header/Header";

const Home = () => {
  const [title, setTitle] = useState("Farkle Scorecard");

  return (
    <div>
      <Header title={title} />

      <style jsx>
        {`
          div {
            max-width: 512px;
            margin: 0 auto;
          }
        `}
      </style>
    </div>
  );
};

export default Home;
